description:
Requiem: Memento Mori is a massively multiplayer online game for mature audiences that will immerse you into a dark world of bloodshed devastated by generations of scientific and magical abuse. You'll need to fight against the grotesque monsters that stalk the cursed land, and band together with your allies to survive against the stronger, bloodthirsty creatures that only prowl at night. Use a wide selection of weapons and the mysterious powers of Beast Possession to strike down your enemies and destroy evil. Requiem Online offers a refreshingly new approach to the MMOPRG genre with its grim, dark atmosphere and tense, blood splattering action. 

